import React from 'react';
import styled from 'styled-components'
import './App.css';

const Title = styled.h1 `
  color: white;
`
const SubTitle = styled.h3 `
  color: white;
`


function App() {
  return (
    <div className="App">
      <Title>Michael Stevens</Title>
      <SubTitle>Full-stack web developer</SubTitle>
    </div>
  );
}

export default App;
